# 哼
bcpic = deepcopy(pics)

# Here we're just categorizing them
#   e.g. Old pics don't even include the '@'
no_at = []
one_at = []
two_at = []

for i in bcpic:
    if i.find("@") == -1:
        no_at.append(i)

for i in bcpic:
    if i.count("@") == 1:
        one_at.append(i)

for i in bcpic:
    if i.count("@@") == 1:
        two_at.append(i)

n0, n1, n2 = deepcopy(no_at), deepcopy(one_at), deepcopy(two_at)

# The core 3 lines
#   Delete suffixes & add the extension.
n0_link = [c.replace(c[c.index('._'):-4], "") for c in n0]
n1_link = [c.replace(c[c.index('@') + 1: -4], "") for c in n1]
n2_link = [c.replace(c[c.index('@') + 2: -4], "") for c in n2]


def testin():
    print(
        n0_link[0],
        n1_link[0],
        n2_link[0],
        sep='\n'
    )


def allpics():
    """ Take this print result to a file! 
        e.g. 
            python3 FILE &> piclinks.txt 
    """
    for i in n0_link:
        print(i)

    for i in n1_link:
        print(i)

    for i in n2_link:
        print(i)


# testin()
allpics()
